INSERT INTO tbl_questionanswer VALUES("364","15","8","Quantity Indicators","Are the maximum and minimum allowable quantities indicated?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("365","15","9","Demarcation of walkways and in-process inventory areas","Are white lines or other markers used to clearly indicate walkways and storage areas?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("366","15","10","Jigs and tools","Are jigs and tools arranged more rationally to facilitate picking them up and returning them?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("367","15","11","Floors","Are floors kept shiny clean and free of waste water and oil?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("368","15","12","Machines","Are the machine wiped clean often and kept free of shavings chips and oil?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("369","15","13","Cleaning and checking","Is equipment inspection combined with equipment maintenance?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("370","15","14","Cleaning responsibilities","Is there a person responsible for overseeing cleaning operations?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("371","15","15","Habitual cleanliness","Do operators habitually sweep floors and wipe equipment without being told?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("372","15","16","Improvement memos","Are improvement memos regularly being generated?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("373","15","17","Improvement ideas","Are improvement ideas being acted on?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("374","15","18","Key procedures","Are standard procedures clear documented and actively used?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("375","15","19","Improvement plan","Are the future standards being considered with a clear improvement plan for the area?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("376","15","20","The first 3 Ss","Are the first 3 Ss (sort set locations and shine) being maintained?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("377","15","21","Training","Is everyone adequately trained in standard procedure?","309","","309");
INSERT INTO tbl_questionanswer VALUES("378","15","22","Tools and parts","Are tools and parts being stored correctly?","309","2012-10-06 04:52:52","309");
INSERT INTO tbl_questionanswer VALUES("379","15","23","Stock controls","Are stock controls being adhered to?","309","2012-10-06 04:52:52","309");
